    {
     "type": "html",
     "name": "question1",
     "html": "<p></p><h4 style=\"text-align:Right\">\nUCSD 802055, UNC IRB 22-0108</h4><p></p>\n\n<p></p><h4 style=\"text-align:Right\">\nScreening Script</h4><p></p>\n\n<h3 style=\"text-align:center\"><p><b>\nUniversity of North Carolina, Chapel Hill</b></p></h3>\n\n<h3 style=\"text-align:center\"><p><b>\nScreening Script with Consent</b></p></h3>\n\n<h4 style=\"text-align:center\"><p><b>\nThe HEALthy Brain and Child Development (HBCD) Study</b></p></h4>\n\n"
    },
    {
     "type": "text",
     "name": "firstName",
     "title": "Potential Participant First Name",
     "hideNumber": true,
     "isRequired": true,
     "readOnly": true,
     "surveyVariable": "ParticipantVariable:firstName"
    },
    {
     "type": "text",
     "name": "lastName",
     "startWithNewLine": false,
     "title": "Potential Participant Last Name",
     "hideNumber": true,
     "isRequired": true,
     "readOnly": true,
     "surveyVariable": "ParticipantVariable:lastName"
    },
    {
     "type": "text",
     "name": "customID",
     "title": "Potential Participant ID",
     "hideNumber": true,
     "readOnly": true,
     "surveyVariable": "StudyInfoVariable:customId"
    },
    {
     "type": "text",
     "name": "Person Conducting Screening Interview",
     "title": "Person Conducting Screening Interview",
     "hideNumber": true,
     "isRequired": true
    },
