  {
   "name": "page3.1",
   "elements": [
    {
     "type": "html",
     "name": "question40",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you agree for you and or your child to participate, we will ask you to take part in completing one to two visits, either during your pregnancy, at less than 1 month of age for your child, or between 3-9 months of age for your child. These visits will take place in-person, or some parts may be done remotely. The length of visits will vary, and may last between approximately one to seven hours per visit (which can be broken up into multiple visits). This will include completing interviews, questionnaires and other tests about yourself and or your child for the visits that are planned for the first year of the study. We may ask you and or your child to wear small devices for a few days to measure heart rate and or movement. We may ask you and or your child to provide some biological samples. Because this study is looking at how a child’s brain develops in the first years of life, we may ask that you allow your child to have brain scans and other measures of how your child’s brain is developing.  </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"> The most serious potential risks of the study are the social and legal risks that could result the loss of your or your child’s confidentiality if we mistakenly share your information with someone outside the study. Every effort will be made to protect your confidentiality. All records collected from you and your child will be identified by unique study ID and will not carry personal identifiers.</p>\n\n<p><br /></p><h4 style=\"text-align:Leftt\">\nVersion 07/30/2022</h4><p></p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page4",
   "elements": [
    {
     "type": "html",
     "name": "question3",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<ul style=\"font-size:16px;color:black\">\n<li>Research is voluntary - whether or not you agree for you and or your child to participate in this research is your decision. You can discuss your decision with others (such as family, friends, or your or your child’s doctor).</li>\n\n<li>You can say yes but change your mind later.</li>\n\n<li>If you say no, we will not hold your decision against you or your child, and your decision will not affect your or your child’s health care or any other benefits you or your child may be entitled to.</li>\n\n<li>Please ask questions or mention concerns before, during or after the research</li>\n</ul>\n\n\n<p style=\"text-align:left;color:black;font-size:16px\"> Additional, detailed information about this research is provided below. </p>\n\n\n\n<br /><h4 style=\"text-align:left\"><b><i>\nWhy you and your child have been asked to participate, how you and your child were selected, and what is the approximate number of participants in the study? </i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You and or your child have been asked to participate in this pilot study because you live in North\nCarolina, you are pregnant or you have a child 9 months of age or younger. There will be\napproximately 10-31 birth parents and their children participating at the Chapel Hill site. There will\nbe approximately 250-450 birth parent-child pairs participating at all 25 sites across the United\nStates.</p>\n"
    }
   ],
