     "html": "<p style=\"text-align:left;color:black;font-size:16px\">The brain MRI visits will be scheduled at the Biomedical Research Imaging Center (BRIC) at UNC\nChapel Hill. We will give you directions and free parking. Because MRI involves being placed in a\nstrong magnetic field, it is not safe for your child to be in or near an MRI scanner if they have metal on\ntheir body, such as pierced earrings. You will be asked to remove anything metallic from your child\nbefore the scan.<br /><br />\nThe EEGs will be done at the BRIC. Your child will wear a special head “net” or cap for a brief\nperiod of time while doing the study tasks.</p>"
