     "type": "html",
     "name": "question5",
     "maxWidth": "600px",
     "html": "<br /><h3 style=\"text-align:center\"> <b>University of North Carolina at Chapel Hill</b></h3>\n\n<h3 style=\"text-align:center\"> <b>HIPAA Authorization for Use and Disclosure of Health Information for Research Purposes</b></h3> \n\n<br />\n<h4 style=\"text-align:left\">\nIRB Study # 22-0108</h4>\n\n<h4 style=\"text-align:left\">\nTitle of Study: HEALthy Brain and Child Development Study (HBCD)</h4>\n\n<h4 style=\"text-align:left\">\nPrincipal Investigator: Lin, Weili</h4>\n\n<h4 style=\"text-align:left\">\nMailing Address for UNC-Chapel Hill Department:  125 Mason Farm Rd. CB 7513 Chapel Hill, NC 27599 </h4>\n<br />\n\n<p style=\"text-align:left;color:black;font-size:16px\">This is a permission called a “HIPAA authorization.” It is required by the “Health Insurance Portability and Accountability Act of 1996” (known as “HIPAA”) in order for us to get information from your medical records or health insurance records to use in this research study.<br /><br />\n</p><ol style=\"text-align:left;color:black;font-size:16px\">\n<li>If you sign this HIPAA authorization form, you are giving your permission for the following people or groups to give the researchers certain information about you (described below):<br /><br />\nAny health care providers or health care professionals or health plans that have provided health services, treatment, or payment for you such as physicians, clinics, hospitals, home health agencies, diagnostics centers, laboratories, treatment or surgical centers, including but not limited to the UNC Health Care System and its members and affiliates (collectively, “UNCHCS”), health insurance plans, and government health agencies.<br /><br />\n</li><li>If you sign this form, this is the health information about you that the people or groups listed in #1 may give to the researchers to use in this research study:<br /><br />\n\nAny information in your medical records that relates to your participation in this research. These records might include information about mental health, drug or alcohol use, HIV/AIDS or other communicable diseases, or genetic testing.\n</li></ol>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page23",
   "elements": [
    {
     "type": "html",
     "name": "question8",
     "maxWidth": "600px",
     "html": "<ol style=\"text-align:left;color:black;font-size:16px\">\n<li>The HIPAA protections that apply to your medical records will not apply to your information when it is in the research study records. Your information in the research study records may also be shared with, used by or seen by collaborating researchers, the sponsor of the research study, the sponsor’s representatives, and certain employees of the University of North Carolina at Chapel Hill or other affiliated entities conducting the research, or government agencies (like the FDA) if needed to oversee the research study. HIPAA rules do not usually apply to those people or groups. If any of these people or groups reviews your research record, they may also need to review portions of your original medical record relevant to the situation. The informed consent document describes the procedures in this research study that will be used to protect your personal information. You can also ask the researchers any questions about what they will do with your personal information and how they will protect your personal information in this research study.<br /><br />\n\nIf study participant payments are described in the consent form, payments may be paid through a partner financial institution or its vendor. By participating in this Study, you authorize the disclosure of limited protected health information to a financial institution or its vendor to facilitate such payments or for tax reporting purposes.<br /><br />\n</li><li>If this research study creates medical information about you that will go into your medical record, you may not be able to see the research study information in your medical record until the entire research study is over.<br /><br />\n</li><li>If you want to participate in this research study, you must sign this HIPAA authorization form to allow the people or groups listed in #1on this form to give access to the information about you that is listed in #2. If you do not want to sign this HIPAA authorization form, you cannot participate in this research study. However, not signing the authorization form will not change your right to treatment, payment, enrollment or eligibility for medical services outside of this research study.<br /><br />\n</li><li>This HIPAA authorization will not stop unless you stop it in writing.<br /><br />\n</li><li>You have the right to stop this HIPAA authorization at any time. You must do that in writing. You may give your written stop of this HIPAA authorization directly to Principal Investigator or researcher or you may mail it to the department mailing address listed at the top of this form, or you may give it to one of the researchers in this study and tell the researcher to send it to any person or group the researcher has given a copy of this HIPAA authorization. Stopping this HIPAA authorization will not stop information sharing that has already happened.<br /><br />\n</li><li>You will be given a copy of this signed HIPAA authorization.</li></ol>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
