     "type": "html",
     "name": "question9",
     "maxWidth": "600px",
     "html": "<br /><h3 style=\"text-align:center\"> <b>University of North Carolina at Chapel Hill</b></h3>\n\n<h3 style=\"text-align:center\"> <b>Consent Addendum for Unencrypted Communication </b></h3> \n\n<br />\n<h4 style=\"text-align:left\">\nIRB Study # 22-0108</h4>\n<h4 style=\"text-align:left\">\nConsent Form Version Date: 12/3/2020</h4>\n\n<h4 style=\"text-align:left\">\nTitle of Study: HEALthy Brain and Child Development Study (HBCD)</h4>\n\n<h4 style=\"text-align:left\">\nPrincipal Investigator: Weili Lin, PhD</h4>\n\n<h4 style=\"text-align:left\">\nUNC-Chapel Hill Department: Radiology</h4>\n<h4 style=\"text-align:left\">\nUNC-Chapel Hill Phone number:  919-843-4438</h4>\n<h4 style=\"text-align:left\">\nFunding Source and/or Sponsor:   National Institutes of Health</h4>\n<h4 style=\"text-align:left\">\nStudy Contact telephone number:     919-843-7943</h4>\n<h4 style=\"text-align:left\">\nStudy Contact email:       arianne_ferrer@med.unc.edu</h4>\n<br />\n\n<p style=\"text-align:left;color:black;font-size:16px\">The following information is regarding un-encrypted communication (e,g., texting or email) by study staff and should be read as an addition to the consent information you have already been provided.  All information previously provided is still true and remains in effect. Your participation continues to be voluntary. You may refuse to participate or may withdraw your consent to participate at any time, and for any reason, without jeopardizing your future care at this institution or your relationship with your study team.<br /><br />\n\nThe study team would like to message you by text messaging, however you may say “no” to receiving these messages and still participate in this study.  If you say “yes”, messages may contain personal information about you and may be sent or received by the study team’s personal electronic devices or in a method that is not able to be encrypted (protected) and there is the risk your information could be shared beyond you and the study team.  This information may include information such as reminders and notifications to contact the study team.  <br /><br />\n \nIf you wish to stop receiving unprotected communication from the study team or have lost access to your device, please notify the study team using the study contact information on the first page of this addendum to the consent.  After the study is complete and all research activities finished, or you withdraw from the study or request to stop receiving unprotected communication, you will no longer receive un-encrypted (un-protected) messages specific to this study.\n</p>"
    }
   ],
